Start throwing into cans. Achieve perfection and play for hours. It is simle, but addictive!
Only you and cans against each other! Aim and throw, it is that simple.
Nice 3D graphics, realistic physics - definitely worth playing. Several different levels, so check them all! 
Aim correctly and use as fewest balls as possible to receive bonuses. Use fast throws to gain ever more points. Be accurate and clever!
Have fun !

